tweet:
In Oregon there are more Covid cases at the end of the lockdown than at the start.

Me: Then what was the point?

@OregonGovBrown:  we’re all in this together I’m extending the lockdown.

I can’t believe this is happening to me.

Even though I am taking all necessary precautions and even if I test negative;

Because I live with someone who actively has COVID, I can’t go back to work for 14 days. I will not get paid for the shifts that were already scheduled.
